    rec.setLongValue(SymbolDatabaseAdapter.SYMBOL_PRIMARY_COL,addressKey);
  }
  rec.setByteValue(SymbolDatabaseAdapter.SYMBOL_FLAGS_COL,(byte)source.ordinal());
  adapter.updateSymbolRecord(rec);
}
